import React from 'react';

export default ({ post }) => {
  const { userId, title, body } = post;
  return (
    <div class='card'>
      <div class='card-header'>
        {userId}
      </div>
      <div class='card-body'>
        <h5 class='card-title'>{title}</h5>
        <p class='card-text'>{body}</p>
      </div>
    </div>
  );
}
;
